description:
Do you have what it takes to be the next Mrs. Fields, Orville Redenbacher or Chef Boyardee? Then you may be a Supermarket Superstar, Lifetime's all-new competition series that will give every day Americans the chance to prove they have the next great product consumers will love. Premiering Monday, July 22, at 10 ET/PT and hosted by Stacy Keibler, Supermarket Superstar gives undiscovered food entrepreneurs their chance to shine among the big brands in the highly competitive food industry. Almost anyone can cook a great meal, but this is the first food competition show that provides a platform for individuals that can change the way millions of Americans shop and eat.

Season 1, Episode 1 - &quot;Cakes (Pilot)&quot;
A gospel singer, a children's party entertainer and a longshoreman compete to get their cakes on supermarket shelves; a group of newlyweds choose the winner.

Season 1, Episode 2 - &quot;Global Cuisine&quot;
A Russian immigrant, a Portuguese-American cook and a food truck entrepreneur prepare their best recipes.

Season 1, Episode 3 - &quot;Natural Foods&quot;
A school teacher, a food-truck entrepreneur and a businessman with a passion for eating bugs compete.

Season 1, Episode 4 - &quot;Baked Goods&quot;
An unemployed mother, a competitive woman and an injured stuntman try to display their culinary prowess in baked goods.

Season 1, Episode 5 - &quot;Spreads and Dips&quot;
A blogger who cooks everything with beer, a Jamaican mom who is pursuing her dream and a valley girl turned health counselor compete.

Season 1, Episode 6 - &quot;Sauces&quot;
A blogger who cooks everything with beer, a Jamaican mom who is pursuing her dream and a valley girl turned health counselor compete.

Season 1, Episode 7 - &quot;Snacks&quot;
A high-strung executive chef, a creatively frustrated film grip and an entrepreneurial mom compete to get their snack products on supermarket shelves across the country.

Season 1, Episode 8 - &quot;Barbeque&quot;
A debt collector in search of a new career, an Iraq war widow struggling to support four kids and a California dreamer compete to get their barbecue on supermarket shelves across the country.

